import React from 'react';
import Home from './Home';

function App() {
  return (
    <div className="App">

      <div className="left">
        <h3>This is the first div</h3>
      </div>

      <div className="right">
        <h3>This is the second div</h3>
      </div>

      <Home />

    </div>
  );
}

export default App;
